d systems";s:4:"text";s:81:"<p>Available for Joomla and WordPress including all features on both systems.</p>";s:6:"filter";b:0;}i:47;a:3:{s:5:"title";s:16:"Frequent updates";s:4:"text";s:66:"<p>Update with ease and get regular improvements and bugfixes.</p>";s:6:"filter";b:0;}i:57;a:3:{s:5:"title";s:10:"Home UIkit";s:4:"text";s:184:"<img src="wp-content/uploads/yootheme/home_logo_uikit.svg" width="100" height="100" alt="Demo">\r\n<h3>UIkit</h3>\r\n<p>The new lightweight and modular front-end framework behind Warp.</p>";s:6:"filter";b:0;}i:58;a:3:{s:5:"title";s:9:"Home LESS";s:4:"text";s:199:"<img src="wp-content/uploads/yootheme/home_logo_less.svg" width="120" height="100" alt="Demo">\r\n<h3>Support for LESS</h3>\r\n<p>The built-in LESS compiler makes using variables and mixins a breeze.</p>";s:6:"filter";b:0;}i:59;a:3:{s:5:"title";s:10:"Home HTML5";s:4:"text";s:198:"<img src="wp-content/uploads/yootheme/home_logo_html5.svg" width="100" height="100" alt="Demo">\r\n<h3>Latest techniques</h3>\r\n<p>The Warp framework is built with HTML5, CSS3, PHP 5.3+ and jQuery.</p>";s:6:"filter";b:0;}i:60;a:3:{s:5:"title";s:13:"Home Features";s:4:"text";s:720:"<div class="uk-grid uk-margin-top uk-margin-bottom">\r\n    <div class="uk-width-1-2">\r\n        <h3 class="uk-h1">Customizer</h3>\r\n        <p class="uk-text-large">Pick colors, select fonts and modify sizes without any CSS coding. See the changes in a real-time preview.</p>\r\n        <img width="545" height="180" src="wp-content/uploads/yootheme/home_customizer.png" alt="Demo">\r\n    </div>\r\n    <div class="uk-width-1-2">\r\n        <h3 class="uk-h1">Mobile menu</h3>\r\n        <p class="uk-text-large">A modern and beautiful off-canvas navigation to enhance your site on mobile devices.</p>\r\n        <img width="545" height="180" src="wp-content/uploads/yootheme/home_mobilemenu.png" alt="Mobile Menu">\r\n    </div>\r\n</div>";s:6:"filter";b:0;}i:61;a:3:{s:5:"title";s:12:"Social Icons";s:4:"text";s:280:"<div class="uk-margin-top">\r\n    <a href="#" class="uk-icon-button uk-icon-github"></a>\r\n    <a href="#" class="uk-icon-button uk-icon-twitter"></a>\r\n    <a href="#" class="uk-icon-button uk-icon-dribbble"></a>\r\n    <a href="#" class="uk-icon-button uk-icon-facebook"></a>\r\n</div>";s:6:"filter";b:0;}i:62;a:3:{s:5:"title";s:0:"";s:4:"text";s:118:"<img src="wp-content/uploads/yootheme/logo_small.svg" width="135" height="40" alt="Demo" class="uk-responsive-height">";s:6:"filter";b:0;}s:12:"_multiwidget";i:1;}', 'yes'),
