(4311, '_transient_dash_4077549d03da2e451c8b5f002294ff51', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2015/05/wordpress-4-2-2/''>WordPress 4.2.2 Security and Maintenance Release</a> <span class="rss-date">May 7, 2015</span><div class="rssSummary">WordPress 4.2.2 is now available. This is a critical security release for all previous versions and we strongly encourage you to update your sites immediately. Version 4.2.2 addresses two security issues: The Genericons icon font package, which is used in a number of popular themes and plugins, contained an HTML file vulnerable to a cross-site [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://wptavern.com/wpweekly-episode-191-proven-guilty-by-a-washing-machine''>WPTavern: WPWeekly Episode 191 â€“ Proven Guilty by a Washing Machine</a></li><li><a class=''rsswidget'' href=''http://ma.tt/2015/05/decades-are-short/''>Matt: Decades are Short</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/xss-vulnerability-in-jetpack-and-the-twenty-fifteen-default-theme-affects-millions-of-wordpress-users''>WPTavern: XSS Vulnerability in Jetpack and the Twenty Fifteen Default Theme Affects Millions of WordPress Users</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Popular Plugin:</span> <a href=''https://wordpress.org/plugins/siteorigin-panels/'' class=''dashboard-news-plugin-link''>Page Builder by SiteOrigin</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=siteorigin-panels&amp;_wpnonce=0d45154f9e&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Page Builder by SiteOrigin''>Install</a>)</span></li></ul></div>', 'no'),
