(86, 1, '2011-06-08 11:32:55', '2011-06-08 11:32:55', '<div class="uk-grid" data-uk-grid-margin>\r\n    <div class="uk-width-medium-2-10 uk-push-8-10 uk-text-center">\r\n        <img src="wp-content/uploads/yootheme/widgetkit_icon.svg" alt="Widgetkit" width="175" height="175">\r\n    </div>\r\n    <div class="uk-width-medium-8-10 uk-pull-2-10">\r\n        <p class="uk-article-lead">Widgetkit is the next generation tool set for Joomla and WordPress. This toolkit is the first of its kind! It provides a simple and user-friendly way to enrich your websites experience with slideshows, galleries, lightboxes and much more.</p>\r\n        <p>All widgets make use of modern web technologies like HTML5 markup, CSS3 features and jQuery based JavaScripts. Widgetkit is fully responsive and all widgets and their effects adapt perfectly for all device resolutions. It supports touch gestures and makes use of smooth CSS3 animations.</p>\r\n        <p><a class="uk-button" href="http://www.yootheme.com/widgetkit" target="_blank">Visit Website</a></p>\r\n    </div>\r\n</div>\r\n\r\n<h2>How it works</h2>\r\n\r\n<p>Widgetkit basically acts as a platform for all our widgets. It installs as a single component in Joomla or as a plugin in WordPress. The Widgetkit dashboard presents you an overview of all widgets. You can create, edit or delete all widgets and their content in one place. And after you have created the content for your first widget, you can either use a shortcode or a module to display your widget anywhere on your website. In fact, you can do both. Because once have you created a widget, you are able to display it multiple times and reuse it on different parts of your website.</p>\r\n\r\n<h2 class="uk-h3">Features</h2>\r\n\r\n<div class="uk-grid" data-uk-grid-margin>\r\n\r\n    <div class="uk-width-medium-1-3">\r\n        <ul class="uk-list uk-list-space">\r\n          <li><i class="uk-icon uk-icon-check"></i> Available for Joomla and WordPress</li>\r\n          <li><i class="uk-icon uk-icon-check"></i> All widgets are fully responsive</li>\r\n          <li><i class="uk-icon uk-icon-check"></i> Use shortcodes to show widgets anywhere</li>\r\n        </ul>\r\n    </div>\r\n\r\n    <div class="uk-width-medium-1-3">\r\n        <ul class="uk-list uk-list-space">\r\n          <li><i class="uk-icon uk-icon-check"></i> Clean and lightweight code</li>\r\n          <li><i class="uk-icon uk-icon-check"></i> Semantic HTML5 markup</li>\r\n          <li><i class="uk-icon uk-icon-check"></i> Asset file minification and compression</li>\r\n        </ul>\r\n    </div>\r\n\r\n    <div class="uk-width-medium-1-3">\r\n        <ul class="uk-list uk-list-space">\r\n          <li><i class="uk-icon uk-icon-check"></i> Supports touch gestures for mobile devices</li>\r\n          <li><i class="uk-icon uk-icon-check"></i> Uses hardware accelerated CSS3 animations</li>\r\n          <li><i class="uk-icon uk-icon-check"></i> Built with PHP 5.3+ and the latest jQuery version</li>\r\n        </ul>\r\n    </div>\r\n</div>\r\n\r\n<div class="uk-grid" data-uk-grid-margin>\r\n    <div class="uk-width-medium-1-1">\r\n        <div class="uk-panel uk-panel-box uk-text-center">\r\n            <p><strong>Get Widgetkit.</strong> The next generation tool set for Joomla and WordPress. <a class="uk-button uk-button-primary uk-margin-left" href="http://www.yootheme.com/widgetkit" target="_blank">Download Widgetkit</a></p>\r\n        </div>\r\n    </div>\r\n</div>', 'Widgetkit', '', 'publish', 'closed', 'closed', '', 'widgetkit', '', '', '2014-04-03 16:52:34', '2014-04-03 16:52:34', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=86', 0, 'page', '', 0),
