(33, 1, '2011-05-02 11:45:48', '2011-05-02 11:45:48', '<p class="uk-article-lead">This theme is built on the <a href="http://www.warp-framework.com">Warp framework</a>, a well-engineered theme framework for WordPress and Joomla, and utilizes all of its latest features. The user interface is powered by <a href="http://www.getuikit.com">UIkit</a>, a lightweight and modular front-end framework, which provides the theme''s styling. The theme also comes with a wide range of different <a href="?page_id=39">layouts and widget variations</a>.</p>\r\n\r\n<div class="uk-grid" data-uk-grid-margin data-uk-grid-match="{target:''.uk-panel''}">\r\n    <div class="uk-width-medium-1-2">\r\n        <div class="uk-panel uk-panel-box">\r\n\r\n            <div class="uk-grid" data-uk-grid-margin>\r\n                <div class="uk-width-large-2-6 uk-text-center">\r\n                    <a class="uk-display-block" href="http://www.warp-framework.com" target="_blank">\r\n                        <img src="wp-content/uploads/yootheme/features_icon_warp.svg" alt="Warp Framework" width="150" height="150">\r\n                    </a>\r\n                </div>\r\n                <div class="uk-width-large-4-6 uk-text-center-medium">\r\n                    <h2>Warp Framework</h2>\r\n                    <p>A fast and slick theme framework which is built on the latest web techniques like HTML5, CSS3 and PHP 5.3+</p>\r\n                    <p><a class="uk-button" href="http://www.warp-framework.com" target="_blank">Visit Website</a></p>\r\n                </div>\r\n            </div>\r\n\r\n        </div>\r\n    </div>\r\n    <div class="uk-width-medium-1-2">\r\n        <div class="uk-panel uk-panel-box">\r\n\r\n            <div class="uk-grid" data-uk-grid-margin>\r\n                <div class="uk-width-large-2-6 uk-text-center">\r\n                    <a class="uk-display-block" href="http://www.getuikit.com" target="_blank">\r\n                        <img src="wp-content/uploads/yootheme/features_icon_uikit.svg" alt="UIkit" width="150" height="150">\r\n                    </a>\r\n                </div>\r\n                <div class="uk-width-large-4-6 uk-text-center-medium">\r\n                    <h2>UIkit</h2>\r\n                    <p>A lightweight and modular front-end framework for developing fast and powerful web interfaces.</p>\r\n                    <p><a class="uk-button" href="http://www.getuikit.com" target="_blank">Visit Website</a></p>\r\n                </div>\r\n            </div>\r\n\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<div class="uk-grid" data-uk-grid-margin>\r\n    <div class="uk-width-medium-1-1">\r\n        <div class="uk-panel uk-panel-box uk-text-center">\r\n            <p>This theme is available for <img src="wp-content/uploads/yootheme/features_icon_joomla.svg" width="25" height="21" alt="Joomla">Joomla and <img src="wp-content/uploads/yootheme/features_icon_wordpress.svg" width="23" height="22" alt="Wordpress">WordPress including the same features on each system.</p>\r\n        </div>\r\n    </div>\r\n</div>', 'Features', '', 'publish', 'closed', 'closed', '', 'features', '', '', '2014-04-09 08:58:44', '2014-04-09 08:58:44', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=33', 0, 'page', '', 0),
