(37, 1, '2011-05-02 11:46:27', '2011-05-02 11:46:27', '<p class="uk-article-lead">YOOtheme is a well-known template and extension provider for Joomla and WordPress who helps you to create professional websites. But to make your website or interface design a real eye-catcher there was one thing missing: Icons! Icons are an essential tool to simplify user interfaces and today almost every major website uses icons to highlight important parts in their content.</p>\r\n\r\n<ul class="uk-grid uk-grid-width-medium-1-2 uk-grid-width-large-1-3" data-uk-grid-margin>\r\n    <li>\r\n        <a class="uk-thumbnail uk-overlay-hover" href="#modal-1" data-uk-modal="{center:true}">\r\n            <div class="uk-overlay">\r\n                <img src="wp-content/uploads/yootheme/icons_buildings.png" width="600" height="400" alt="Building Icons">\r\n                <div class="uk-overlay-panel uk-overlay-icon uk-overlay-background uk-overlay-fade"></div>\r\n            </div>\r\n            <div class="uk-thumbnail-caption">Building Icons</div>\r\n        </a>\r\n    </li>\r\n    <li>\r\n        <a class="uk-thumbnail uk-overlay-hover" href="#modal-2" data-uk-modal="{center:true}">\r\n            <div class="uk-overlay">\r\n                <img src="wp-content/uploads/yootheme/icons_hosting.png" width="600" height="400" alt="Hosting Icons">\r\n                <div class="uk-overlay-panel uk-overlay-icon uk-overlay-background uk-overlay-fade"></div>\r\n            </div>\r\n            <div class="uk-thumbnail-caption">Hosting Icons</div>\r\n        </a>\r\n    </li>\r\n    <li>\r\n        <a class="uk-thumbnail uk-overlay-hover" href="#modal-3" data-uk-modal="{center:true}">\r\n            <div class="uk-overlay">\r\n                <img src="wp-content/uploads/yootheme/icons_tools.png" width="600" height="400" alt="Tool Icons">\r\n                <div class="uk-overlay-panel uk-overlay-icon uk-overlay-background uk-overlay-fade"></div>\r\n            </div>\r\n            <div class="uk-thumbnail-caption">Tool Icons</div>\r\n        </a>\r\n    </li>\r\n    <li>\r\n        <a class="uk-thumbnail uk-overlay-hover" href="#modal-4" data-uk-modal="{center:true}">\r\n            <div class="uk-overlay">\r\n                <img src="wp-content/uploads/yootheme/icons_shipping.png" width="600" height="400" alt="Shipping Icons">\r\n                <div class="uk-overlay-panel uk-overlay-icon uk-overlay-background uk-overlay-fade"></div>\r\n            </div>\r\n            <div class="uk-thumbnail-caption">Shipping Icons</div>\r\n        </a>\r\n    </li>\r\n    <li>\r\n        <a class="uk-thumbnail uk-overlay-hover" href="#modal-5" data-uk-modal="{center:true}">\r\n            <div class="uk-overlay">\r\n                <img src="wp-content/uploads/yootheme/icons_ecommerce.png" width="600" height="400" alt="E-Commerce Icons">\r\n                <div class="uk-overlay-panel uk-overlay-icon uk-overlay-background uk-overlay-fade"></div>\r\n            </div>\r\n            <div class="uk-thumbnail-caption">E-Commerce Icons</div>\r\n        </a>\r\n    </li>\r\n    <li>\r\n        <a class="uk-thumbnail uk-overlay-hover" href="#modal-6" data-uk-modal="{center:true}">\r\n            <div class="uk-overlay">\r\n                <img src="wp-content/uploads/yootheme/icons_space.png" width="600" height="400" alt="Space Icons">\r\n                <div class="uk-overlay-panel uk-overlay-icon uk-overlay-background uk-overlay-fade"></div>\r\n            </div>\r\n            <div class="uk-thumbnail-caption">Space Icons</div>\r\n        </a>\r\n    </li>\r\n</ul>\r\n\r\n<h2 class="uk-h3">Features</h2>\r\n\r\n<div class="uk-grid uk-grid-divider" data-uk-grid-margin>\r\n    <div class="uk-width-medium-1-3">\r\n       <div class="uk-grid">\r\n            <div class="uk-width-large-1-6 uk-vertical-align uk-text-center" style="height: 50px;">\r\n                <div class="uk-vertical-align-middle">\r\n                    <i class="uk-icon-paste uk-icon-medium uk-text-primary"></i>\r\n                </div>\r\n            </div>\r\n            <div class="uk-width-large-5-6 uk-text-center-small uk-text-center-medium">\r\n                <h3 class="uk-h4 uk-margin-bottom-remove">PNGs in 8 Sizes</h3>\r\n                <p class="uk-margin-top-remove">From 16x16 to 512x512 pixels. </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n\r\n    <div class="uk-width-medium-1-3">\r\n        <div class="uk-grid">\r\n            <div class="uk-width-large-1-6 uk-vertical-align uk-text-center" style="height: 50px;">\r\n                <div class="uk-vertical-align-middle">\r\n                    <i class="uk-icon-sort-amount-asc uk-icon-medium uk-text-primary"></i>\r\n                </div>\r\n            </div>\r\n            <div class="uk-width-large-5-6 uk-text-center-small uk-text-center-medium">\r\n                <h3 class="uk-h4 uk-margin-bottom-remove">Scalable vector sources</h3>\r\n                <p class="uk-margin-top-remove">Customizable PDF vector files.</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n\r\n    <div class="uk-width-medium-1-3">\r\n        <div class="uk-grid">\r\n            <div class="uk-width-large-1-6 uk-vertical-align uk-text-center" style="height: 50px;">\r\n                <div class="uk-vertical-align-middle">\r\n                    <i class="uk-icon-tint uk-icon-medium uk-text-primary"></i>\r\n                </div>\r\n            </div>\r\n            <div class="uk-width-large-5-6 uk-text-center-small uk-text-center-medium">\r\n                <h3 class="uk-h4 uk-margin-bottom-remove">Pixel perfect design</h3>\r\n                <p class="uk-margin-top-remove">Handcrafted every size.</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n\r\n    <div class="uk-width-medium-1-1">\r\n        <div class="uk-panel uk-panel-box uk-text-center">\r\n            <p><strong>YOOtheme Icons.</strong> Beautiful and handcrafted icons for web and print projects. <a class="uk-button uk-button-primary uk-margin-left" href="http://www.yootheme.com/icons" target="_blank">Visit Website</a></p>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<div id="modal-1" class="uk-modal">\r\n    <div class="uk-modal-dialog uk-modal-dialog-lightbox">\r\n        <a href="" class="uk-modal-close uk-close uk-close-alt"></a>\r\n        <img src="wp-content/uploads/yootheme/icons_buildings.png" width="600" height="400" alt="Building Icons">\r\n    </div>\r\n</div>\r\n\r\n<div id="modal-2" class="uk-modal">\r\n    <div class="uk-modal-dialog uk-modal-dialog-lightbox">\r\n        <a href="" class="uk-modal-close uk-close uk-close-alt"></a>\r\n        <img src="wp-content/uploads/yootheme/icons_hosting.png" width="600" height="400" alt="Hosting Icons">\r\n    </div>\r\n</div>\r\n\r\n<div id="modal-3" class="uk-modal">\r\n    <div class="uk-modal-dialog uk-modal-dialog-lightbox">\r\n        <a href="" class="uk-modal-close uk-close uk-close-alt"></a>\r\n        <img src="wp-content/uploads/yootheme/icons_tools.png" width="600" height="400" alt="Tool Icons">\r\n    </div>\r\n</div>\r\n\r\n<div id="modal-4" class="uk-modal">\r\n    <div class="uk-modal-dialog uk-modal-dialog-lightbox">\r\n        <a href="" class="uk-modal-close uk-close uk-close-alt"></a>\r\n        <img src="wp-content/uploads/yootheme/icons_shipping.png" width="600" height="400" alt="Shipping Icons">\r\n    </div>\r\n</div>\r\n\r\n<div id="modal-5" class="uk-modal">\r\n    <div class="uk-modal-dialog uk-modal-dialog-lightbox">\r\n        <a href="" class="uk-modal-close uk-close uk-close-alt"></a>\r\n        <img src="wp-content/uploads/yootheme/icons_ecommerce.png" width="600" height="400" alt="E-Commerce Icons">\r\n    </div>\r\n</div>\r\n\r\n<div id="modal-6" class="uk-modal">\r\n    <div class="uk-modal-dialog uk-modal-dialog-lightbox">\r\n        <a href="" class="uk-modal-close uk-close uk-close-alt"></a>\r\n        <img src="wp-content/uploads/yootheme/icons_space.png" width="600" height="400" alt="Space Icons">\r\n    </div>\r\n</div>', 'Icons', '', 'publish', 'closed', 'closed', '', 'icons', '', '', '2015-02-13 12:37:57', '2015-02-13 12:37:57', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=37', 0, 'page', '', 0),
(39, 1, '2011-05-02 11:46:45', '2011-05-02 11:46:45', '<p>Warp comes with a sophisticated layout system to create any kind of sidebar or widget layout. You can easily manage the sidebar''s positions and widths in the theme administration. Widgets can have different styles and be placed in any position offered by this theme. Each position has its own layout. You can align widgets side-by-side, stack them or choose your own grid layout. Show or hide widgets on mobile devices, while the grid adapts perfectly to your layout.</p>\r\n\r\n<img src="wp-content/uploads/yootheme/features_layouts.svg" width="560" height="320" alt="Warp Layout System" title="Warp Layout System" />', 'Layouts', '', 'publish', 'closed', 'closed', '', 'layouts', '', '', '2013-06-28 07:16:32', '2013-06-28 07:16:32', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=39', 0, 'page', '', 0),
