(42, 1, '2011-05-02 11:53:07', '2011-05-02 11:53:07', 'This theme comes with different module styles, badges and icons. For each module you can pick a style and combine it with an icon or badge to create your own unique look. Here is a list of the available options: Styles Box Badges Hot, New, Free, Top Icons Download, Twitter, Mail, Bubble, Login, Cart', '', '', 'publish', 'open', 'open', '', '42', '', '', '2014-04-03 16:53:05', '2014-04-03 16:53:05', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?p=42', 3, 'nav_menu_item', '', 0),
(43, 1, '2011-05-02 11:53:07', '2011-05-02 11:53:07', 'YOOtheme is a well-known template and extension provider for Jooomla and WordPress who helps you to create professional websites. But to make your website or interface design a real eye-catcher we had one thing missing: Icons! Icons are an essential tool to simplify user interfaces and today almost every major website uses icons to highlight important parts in their content. This is why we created a great resource of beautiful and handcrafted icons for web and print projects. We got commercial icon sets including e-commerce, community, file and folder icons and many more as well as many freebies. Club Icons As a member of our icon club you will get access to hundreds of handcrafted and detailed icons. New icon sets are added continuously! Pixel perfect design PNGs in 8 sizes from 16Ã—16 to 512Ã—512 pixels Handmade and optimized for each size Editable vector PDF sources Change the colors and customize easily Read more', '', '', 'publish', 'open', 'open', '', '43', '', '', '2014-04-03 16:53:05', '2014-04-03 16:53:05', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?p=43', 6, 'nav_menu_item', '', 0),
(44, 1, '2011-05-02 11:53:07', '2011-05-02 11:53:07', 'You can create some beautiful content by using some simple HTML elements. The Warp theme framework offers some neat styles for all HTML elements and a great set of CSS classes to style your content. Basic HTML is very easy to learn and this small guide shows you how to use all styles provided by the Warp framework. Basic HTML Elements Here is a short demonstration of text-level semanticts. The element creates a new paragraph. It will have some space before and after itself. To turn your text into hypertext just use the element. Text-Level Semantics You can emphasize text using the element or to imply any extra importance the element. Highlight text with no semantic meaning using the element. Markup document changes like inserted or deleted text with the element or element. To define an abbreviation use the element and to define a definition term use the element. Short List with Links YOOtheme â€“ Premium Joomla Templates and WordPress Themes Warp Framework â€“ Fast and Slick Theme Framework ZOO â€“ Content Application Builder Stock Icons â€“ For Web and Print Projects Quotations and Code Inline quotations can be defined by using the element. The element defines a long quotationâ€¦', '', '', 'publish', 'open', 'open', '', '44', '', '', '2014-04-03 16:53:05', '2014-04-03 16:53:05', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?p=44', 4, 'nav_menu_item', '', 0),
(45, 1, '2011-05-02 11:53:07', '2011-05-02 11:53:07', 'This theme utilizes the latest features of the fast and slick Warp theme framework. It comes with a broad range of layout and module variations as well as a neat typography to style your content. Read on to learn more about this theme and its features: Available for Joomla and Wordpress 5 style variations available Choose from 5 colors and 8 fonts 1 module style combinable with 4 badges and 6 icons Flexible template and column widths All Warp framework features are available Easy Installation and Customization Demo Packages We provide demo packages with the theme sample data for Joomla and Wordpress to get you started right. Image Sources Sliced and editable Adobe Fireworks image source files are available to customize the theme easily. Theme Styles We provide different style variations of the default theme. In addition to these styles we added several other style settings like colors and fonts. Combining the different style options allows you to create your own unique theme design. Theme Profiles We created some nice theme profiles using the different styles, colors and fonts, you can choose from in the theme administration. You can create your own profiles and even assign them to different menuâ€¦', '', '', 'publish', 'open', 'open', '', '45', '', '', '2014-04-03 16:53:05', '2014-04-03 16:53:05', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?p=45', 2, 'nav_menu_item', '', 0),
