(88, 1, '2011-06-08 11:33:12', '2011-06-08 11:33:12', '<p>The Widgetkit Slideshow is the ultimate image and content slideshow for Joomla and WordPress. It''s flexible, easy to customize and completely built with HTML5 and CSS3. </p>\r\n\r\n<h2>Features</h2>\r\n\r\n<ul class="uk-list uk-list-space">\r\n    <li><i class="uk-icon uk-icon-check"></i> Clean and very lightweight code</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> 17 eye-catching transition effects</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Fully responsive including all effects</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Uses hardware accelerated CSS3 animations</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Supports HTML captions</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Swipe navigation on mobile devices</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Built with HTML5, CSS3, PHP 5.3+ and the latest jQuery version</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Works with Joomla and WordPress</li>\r\n</ul>\r\n\r\n<h2>Slideshow Screen Example</h2>\r\n<p>This is an image slideshow with the famous Ken Burns effect.</p>\r\n[widgetkit id=554]\r\n\r\n<h2>Slideshow Default Example</h2>\r\n<p>This is an image slideshow with eye-catching transition effects.</p>\r\n[widgetkit id=501]\r\n\r\n<h2>Showcase Box Example</h2>\r\n<p>This a content showcase using all the features from the Slideset widget as a navigation. Any kind of HTML content can be used inside the navigation.</p>\r\n[widgetkit id=533]\r\n\r\n<h2>Showcase Button Example</h2>\r\n<p>This is an image slideshow with some nice navigation buttons. You can place any kind of HTML in the navigation buttons.</p>\r\n[widgetkit id=534]\r\n\r\n<h2>Tabs Example</h2>\r\n<p>This is a classic, tabbed slideshow. Tabs can be aligned to the left, right and center.</p>\r\n[widgetkit id=531]\r\n\r\n<h2>Tabs Bar Example</h2>\r\n<p>This is a slideshow with a tabbed navigation bar. Tabs can be aligned to the left, right and center.</p>\r\n[widgetkit id=532]\r\n\r\n<h2>List Example</h2>\r\n<p>This is a slideshow with a vertical tabbed list as a navigation.</p>\r\n[widgetkit id=530]\r\n\r\n<h2>How To Use</h2>\r\n\r\n<p>The Widgetkit Slideshow takes full advantage of the very user-friendly Widgetkit administration user interface. It has never been easier to create and manage all the slideshows and their different slides in one place. After you created a slideshow you can load it anywhere in your theme using shortcodes or the universal Widgetkit Joomla module or WordPress widget.</p>', 'Slideshow', '', 'publish', 'closed', 'closed', '', 'slideshow', '', '', '2013-06-25 13:55:04', '2013-06-25 13:55:04', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=88', 0, 'page', '', 0),
(90, 1, '2011-06-08 11:33:28', '2011-06-08 11:33:28', '<p>The Widgetkit Lightbox allows you to view images, HTML and multi-media content on a dark dimmed overlay without having to leave the current page.</p>\r\n\r\n<h2>Features</h2>\r\n\r\n<ul class="uk-list uk-list-space">\r\n    <li><i class="uk-icon uk-icon-check"></i> Display images, videos, HTML, Iframes, Ajax requests and SWF</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Supports YouTube, Vimeo, MP4 (h.264), WebM and FLV movies</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Group lightboxes and mix different content types</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Responsive design to fit all device resolutions</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Load other widgets in a lightbox</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> 3 different opening and closing transitions</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> 4 different caption styles</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Keyboard and mouse scroll wheel navigation</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Built on the latest jQuery version</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Works with Joomla and WordPress</li>\r\n</ul>\r\n\r\n<h2>Examples</h2>\r\n\r\n<p>Different animations - <code>fade</code>, <code>elastic</code> and <code>none</code></p>\r\n<p class="gallery">\r\n    <a data-lightbox="transitionIn:fade;transitionOut:fade;" href="wp-content/uploads/yootheme/widgetkit/lightbox/image1_lightbox.jpg"><img src="wp-content/uploads/yootheme/widgetkit/lightbox/image1.jpg" width="180" height="120" alt="Lightbox Image" /></a>\r\n    <a data-lightbox="transitionIn:elastic;transitionOut:elastic;" href="wp-content/uploads/yootheme/widgetkit/lightbox/image2_lightbox.jpg"><img src="wp-content/uploads/yootheme/widgetkit/lightbox/image2.jpg" width="180" height="120" alt="Lightbox Image" /></a>\r\n    <a data-lightbox="transitionIn:none;transitionOut:none;" href="wp-content/uploads/yootheme/widgetkit/lightbox/image3_lightbox.jpg"><img src="wp-content/uploads/yootheme/widgetkit/lightbox/image3.jpg" width="180" height="120" alt="Lightbox Image" /></a>\r\n</p>\r\n\r\n<p>Different title positions - <code>float</code>, <code>inside</code> and <code>over</code></p>\r\n<p class="gallery">\r\n    <a data-lightbox="group:mygroup1;titlePosition:float" href="wp-content/uploads/yootheme/widgetkit/lightbox/image4_lightbox.jpg" title="Title Position: Float"><img src="wp-content/uploads/yootheme/widgetkit/lightbox/image4.jpg" width="180" height="120" alt="Lightbox Image" /></a>\r\n    <a data-lightbox="group:mygroup1;titlePosition:inside" href="wp-content/uploads/yootheme/widgetkit/lightbox/image5_lightbox.jpg" title="Title Position: Inside"><img src="wp-content/uploads/yootheme/widgetkit/lightbox/image5.jpg" width="180" height="120" alt="Lightbox Image" /></a>\r\n    <a data-lightbox="group:mygroup1;titlePosition:over;padding:0" href="wp-content/uploads/yootheme/widgetkit/lightbox/image6_lightbox.jpg" title="Title Position: Over and Padding set to 0"><img src="wp-content/uploads/yootheme/widgetkit/lightbox/image6.jpg" width="180" height="120" alt="Lightbox Image" /></a>\r\n</p>\r\n\r\n<p>Various examples in one gallery (try also using the keyboard and mouse scroll wheel)</p>\r\n<ul>\r\n    <li><a data-lightbox="group:mygroup2" href="http://www.youtube.com/watch?v=R55e-uHQna0" title="YouTube Video">YouTube</a></li>\r\n    <li><a data-lightbox="group:mygroup2" href="http://vimeo.com/15261921" title="Vimeo Video">Vimeo</a></li>\r\n    <li><a data-lightbox="group:mygroup2;autoplay:true;" href="http://www.yootheme.com/videos/mediaplayer.mp4" title="MP4 (h.264)">MP4 (h.264)</a></li>\r\n    <li><a data-lightbox="group:mygroup2" href="http://www.adobe.com/jp/events/cs3_web_edition_tour/swfs/perform.swf" title="Flash Swf">Swf</a></li>\r\n    <li><a data-lightbox="group:mygroup2" href="#inline" title="Inline Content from the Website">Inline</a></li>\r\n    <li><a data-lightbox="group:mygroup2;width:1000;height:600" title="Iframe" href="http://www.wikipedia.org">Iframe</a></li>\r\n</ul>\r\n\r\n<div style="display: none;">\r\n    <div id="inline" style="width: 400px; height: 100px; overflow: auto;">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</div>\r\n</div>\r\n\r\n<h2>Load Widgets In A Lightbox</h2>\r\n<p>Use <code>#wk-ID</code> to load widgets like slideshows or galleries in a lightbox. For example: <a data-lightbox="width:600;height:300;" href="#wk-50" title="Widgetkit Slideshow">Widgetkit Slideshow</a></p>\r\n<pre>&lt;a data-lightbox=&quot;width:600;height:300;&quot; href=&quot;#wk-10&quot;&gt;Lightbox&lt;/a&gt;</pre>\r\n\r\n<h2>How To Use</h2>\r\n\r\n<p>Use the HTML5 custom data attribute <code>data-lightbox</code> to activate the lightbox. You can set various lightbox parameters to the data attribute. For example:</p>\r\n\r\n<pre>&lt;a data-lightbox=&quot;width:1000;height:600;&quot; href=&quot;http://www.wikipedia.org&quot;&gt;Lightbox&lt;/a&gt;</pre>\r\n\r\n<p>Here is a list of the most common parameters:</p>\r\n\r\n<ul>\r\n    <li><strong>titlePosition</strong> - How should the title show up? (<code>float</code>, <code>outside</code>, <code>inside</code> or <code>over</code>)</li>\r\n    <li><strong>transitionIn</strong> - Set a opening transition. (<code>fade</code>, <code>elastic</code>, or <code>none</code>)</li>\r\n    <li><strong>transitionOut</strong> - Set a closing transition (<code>fade</code>, <code>elastic</code>, or <code>none</code>)</li>\r\n    <li><strong>overlayShow</strong> - Set to <code>true</code> or <code>false</code></li>\r\n    <li><strong>scrolling</strong> - Set to <code>yes</code> or <code>no</code></li>\r\n    <li><strong>width</strong> - Set a width in pixel</li>\r\n    <li><strong>height</strong> - Set a height in pixel</li>\r\n    <li><strong>padding</strong> - Set a padding in pixel</li>\r\n</ul>', 'Lightbox', '', 'publish', 'closed', 'closed', '', 'lightbox', '', '', '2013-06-25 11:41:17', '2013-06-25 11:41:17', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=90', 0, 'page', '', 0),
(92, 1, '2011-06-08 11:33:45', '2011-06-08 11:33:45', '<p>The Widgetkit Spotlight allows you to add an overlay to your images, which fades or moves in on mouse hover. The overlay can be an image or HTML content. The default magnifier spotlight is a perfect match for the Widgetkit lightbox.</p>\r\n\r\n<h2>Features</h2>\r\n\r\n<ul class="uk-list uk-list-space">\r\n    <li><i class="uk-icon uk-icon-check"></i> Create nicely animated image overlays</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Supports custom image or HTML content overlays</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> 5 different animation modes</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Responsive design to fit all device resolutions</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Built with the latest jQuery version</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Works with Joomla and WordPress</li>\r\n</ul>\r\n\r\n<h2>Examples</h2>\r\n\r\n<p>If no custom overlay is set, the default spotlight fades in an overlay with a magnifier image. If you define a custom overlay, you can choose between different animations - <code>fade</code>, <code>bottom</code>, <code>top</code>, <code>right</code> and <code>left</code>.</p>\r\n\r\n<div>\r\n    <a data-spotlight="on" data-lightbox="transitionIn:elastic;transitionOut:elastic;" href="wp-content/uploads/yootheme/widgetkit/lightbox/image1_lightbox.jpg">\r\n        <img src="wp-content/uploads/yootheme/widgetkit/lightbox/image1.jpg" width="180" height="120" alt="Spotlight Image" />\r\n    </a>\r\n    <a data-spotlight="effect:bottom;" data-lightbox="transitionIn:elastic;transitionOut:elastic;" href="wp-content/uploads/yootheme/widgetkit/lightbox/image2_lightbox.jpg">\r\n        <img src="wp-content/uploads/yootheme/widgetkit/lightbox/image2.jpg" width="180" height="120" alt="Spotlight Image" />\r\n        <div class="overlay">Custom Overlay (Bottom)</div>\r\n    </a>\r\n    <a data-spotlight="effect:right;" data-lightbox="transitionIn:elastic;transitionOut:elastic;" href="wp-content/uploads/yootheme/widgetkit/lightbox/image3_lightbox.jpg">\r\n        <img src="wp-content/uploads/yootheme/widgetkit/lightbox/image3.jpg" width="180" height="120" alt="Spotlight Image" />\r\n        <div class="overlay">Custom Overlay (Right)</div>\r\n    </a>\r\n</div>\r\n\r\n<div>\r\n    <a data-spotlight="effect:fade;" data-lightbox="transitionIn:elastic;transitionOut:elastic;" href="wp-content/uploads/yootheme/widgetkit/lightbox/image4_lightbox.jpg">\r\n        <img src="wp-content/uploads/yootheme/widgetkit/lightbox/image4.jpg" width="180" height="120" alt="Spotlight Image" />\r\n        <div class="overlay remove-padding"><img src="wp-content/uploads/yootheme/widgetkit/lightbox/image4_spotlight.jpg" width="180" height="120" alt="Spotlight Image" /></div>\r\n    </a>\r\n    <a data-spotlight="effect:top;" data-lightbox="transitionIn:elastic;transitionOut:elastic;" href="wp-content/uploads/yootheme/widgetkit/lightbox/image5_lightbox.jpg">\r\n        <img src="wp-content/uploads/yootheme/widgetkit/lightbox/image5.jpg" width="180" height="120" alt="Spotlight Image" />\r\n        <div class="overlay">Custom Overlay (Top)</div>\r\n    </a>\r\n    <a data-spotlight="effect:left;" data-lightbox="transitionIn:elastic;transitionOut:elastic;" href="wp-content/uploads/yootheme/widgetkit/lightbox/image6_lightbox.jpg">\r\n        <img src="wp-content/uploads/yootheme/widgetkit/lightbox/image6.jpg" width="180" height="120" alt="Spotlight Image" />\r\n        <div class="overlay">Custom Overlay (Left)</div>\r\n    </a>\r\n</div>\r\n\r\n<h2>How To Use</h2>\r\n\r\n<p>Use the HTML5 custom data attribute <code>data-spotlight</code> to activate the spotlight.\r\n\r\n<pre>&lt;a data-spotlight="on" href="/mypage.html"&gt;\r\n    &lt;img src="/image.jpg" width="180" height="120" alt="" /&gt;\r\n&lt;/a&gt;</pre>\r\n\r\n<p>To create a custom overlay, use a div element with the CSS class <code>overlay</code>. You can set the effect parameter to the data attribute. For example:</p>\r\n\r\n<pre>&lt;a data-spotlight="effect:bottom;" href="/mypage.html"&gt;\r\n    &lt;img src="/image.jpg" width="180" height="120" alt="" /&gt;\r\n    &lt;div class="overlay"&gt;Custom Overlay&lt;/div&gt;\r\n&lt;/a></pre>\r\n\r\n<p>You can set the effect parameter to <code>fade</code>, <code>bottom</code>, <code>top</code>, <code>right</code> and <code>left</code>.', 'Spotlight', '', 'publish', 'closed', 'closed', '', 'spotlight', '', '', '2013-06-25 13:19:34', '2013-06-25 13:19:34', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=92', 0, 'page', '', 0),
(94, 1, '2011-06-08 11:34:00', '2011-06-08 11:34:00', '<p>The Widgetkit Twitter module is the neatest way to display tweets directly on your website. All displayed tweets get cached so they show up super fast, even if Twitter is not available.</p>\r\n\r\n<h2>Features</h2>\r\n\r\n<ul class="uk-list uk-list-space">\r\n    <li><i class="uk-icon uk-icon-check"></i> Filter tweets by hashtags, words, from users, to users, referencing users</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Block tweets using a blacklist</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Tweets are cached for high performance</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Tweets show up even if Twitter is not available</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> 3 different styles to show your tweets</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Responsive design to fit all device resolutions</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Built with HTML5 using article and time elements</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Works with Joomla and WordPress</li>\r\n</ul>\r\n\r\n<h2>How To Use</h2>\r\n\r\n<p>Create a Twitter module in Joomla or a Twitter widget in WordPress and publish it in a module position. A lot of options are available to choose which tweets you want to show.</p>\r\n\r\n<p>For example you can show only tweets from a specific user or tweets that contain a certain hash-tag or a specific word. All options can be combined. To filter by more than one word or user use a space between them. For example: <code>yootheme joomla</code>.</p>', 'Twitter', '', 'publish', 'closed', 'closed', '', 'twitter', '', '', '2013-06-25 13:20:18', '2013-06-25 13:20:18', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=94', 0, 'page', '', 0),
(100, 1, '2011-06-08 11:34:26', '2011-06-08 11:34:26', 'Widgetkit is the next generation tool set for Joomla and WordPress. This toolkit is the first of its kind! It provides a simple and user-friendly way to enrich your websites experience with widgets like Slideshow, Lightbox, Spotlight and Twitter. All widgets make use of modern web technologies like HTML5 markup, CSS3 features and jQuery based JavaScripts. Widgetkit also works on iPads, iPhones and Android phones or tablets. It supports touch gestures and makes use of smooth CSS3 animations. Here is a short feature roundup: Features Available for Joomla and WordPress All widgets can work stand-alone Use shortcodes to show widgets anywhere Clean and lightweight code Semantic HTML5 markup Asset file Minification and Compression Supports touch gestures for mobile devices Uses hardware accelerated CSS3 animations Built with HTML5, CSS3, PHP 5.2+, latest jQuery version How It Works Widgetkit basically acts as a platform for all our widgets. It installs as a single component in Joomla or as a plugin in WordPress 3.x. The Widgetkit dashboard presents you an overview of all widgets. You can create, edit or delete all widgets and their content in one place. And after you have created the content for your first widget you can either useâ€¦', '', '', 'publish', 'open', 'open', '', '100', '', '', '2014-04-03 16:53:05', '2014-04-03 16:53:05', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?p=100', 5, 'nav_menu_item', '', 0),
(501, 1, '2011-03-15 15:46:28', '2011-03-15 15:46:28', '{"type":"slideshow","id":501,"name":"Demo Default","settings":{"style":"default","autoplay":1,"interval":5000,"width":600,"height":300,"duration":500,"index":0,"order":"default","navigation":1,"buttons":1,"slices":15,"animated":"randomFx","caption_animation_duration":500},"style":"default","items":{"4d7f89db79906":{"title":"Slide 1","content":"<a href=\\"#\\"><img src=\\"wp-content\\/uploads\\/yootheme\\/widgetkit\\/slideshow\\/image1.jpg\\" alt=\\"Image 01\\" width=\\"600\\" height=\\"300\\"><\\/a>","caption":""},"4d7f89eab0e52":{"title":"Slide 2","content":"<a href=\\"#\\"><img src=\\"wp-content\\/uploads\\/yootheme\\/widgetkit\\/slideshow\\/image2.jpg\\" alt=\\"Image 02\\" width=\\"600\\" height=\\"300\\"><\\/a>","caption":"This is a HTML caption with a <a href=\\"#\\">link<\\/a>."},"4d7f89f30cf9a":{"title":"Slide 3","content":"<a href=\\"#\\"><img src=\\"wp-content\\/uploads\\/yootheme\\/widgetkit\\/slideshow\\/image3.jpg\\" alt=\\"Image 03\\" width=\\"600\\" height=\\"300\\"><\\/a>","caption":"This is another HTML caption with a <a href=\\"#\\">link<\\/a>."},"4d878180d9e3a":{"title":"Slide 4","content":"<a href=\\"#\\"><img src=\\"wp-content\\/uploads\\/yootheme\\/widgetkit\\/slideshow\\/image4.jpg\\" alt=\\"Image 04\\" width=\\"600\\" height=\\"300\\"><\\/a>","caption":""},"4d87818847080":{"title":"Slide 5","content":"<a href=\\"#\\"><img src=\\"wp-content\\/uploads\\/yootheme\\/widgetkit\\/slideshow\\/image5.jpg\\" alt=\\"Image 05\\" width=\\"600\\" height=\\"300\\"><\\/a>","caption":""}}}', 'Demo Default', 'default', 'publish', 'closed', 'closed', '', 'test', '', '', '2013-06-26 13:40:03', '2013-06-26 13:40:03', '', 0, 'http://192.168.1.50/Widgetkit/Website_WP/?p=22', 0, 'widgetkit', 'slideshow', 0),
(110, 1, '2011-07-31 16:55:26', '2011-07-31 16:55:26', '<p>The Widgetkit Accordion enables you to display a set of items in a compact space. When clicking on each item''s header, it expands or collapses its content section.</p>\r\n\r\n<h2>Features</h2>\r\n\r\n<ul class="uk-list uk-list-space">\r\n    <li><i class="uk-icon uk-icon-check"></i> Clean and very lightweight code</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Responsive design to fit all device resolutions</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Smooth transitions on content section toggle</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Option to automatically match the height of varying content</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Option to auto collapse or allow multiple opened items</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Built with HTML5, CSS3, PHP 5.3+ and the latest jQuery version</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Works with Joomla and WordPress</li>\r\n</ul>\r\n\r\n<h2>Example</h2>\r\n\r\n[widgetkit id=503]\r\n\r\n<h2>How To Use</h2>\r\n\r\n<p>The Widgetkit Accordion lets you easily create and manage all the accordion''s contents through the user-friendly Widgetkit administration interface. After you have created an accordion, you can load it anywhere on your website using shortcodes or the universal Widgetkit Joomla module or WordPress widget.</p>', 'Accordion', '', 'publish', 'closed', 'closed', '', 'accordion', '', '', '2013-06-25 13:53:17', '2013-06-25 13:53:17', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=110', 0, 'page', '', 0),
(112, 1, '2011-07-31 16:55:44', '2011-07-31 16:55:44', '<p>The Widgetkit Gallery provides a smart and automated way to publish images on your website. You only need to select the image folders and the whole gallery is generated automatically.</p>\r\n\r\n<h2>Features</h2>\r\n\r\n<ul class="uk-list uk-list-space">\r\n    <li><i class="uk-icon uk-icon-check"></i> Fully responsive including all effects</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Folder based image selection</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Supports multiple image folders</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Automatic thumbnail creation</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Supports image captions and custom links</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Uses the Widgetkit Spotlight and Lightbox</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Built with HTML5, CSS3, PHP 5.3+ and the latest jQuery version</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Works with Joomla and WordPress</li>\r\n</ul>\r\n\r\n<h2>Showcase Box Example</h2>\r\n<p>This is an image showcase with eye-catching transition effects and a thumbnail navigation.</p>\r\n[widgetkit id=528]\r\n\r\n<h2>Image Wall Example</h2>\r\n<p>This is an image wall with zoom effect, no margins and squared corners using the lightbox.</p>\r\n[widgetkit id=504]\r\n\r\n<h2>Polaroid Example</h2>\r\n<p>This is an image wall with scattered polaroid pictures using the lightbox.</p>\r\n[widgetkit id=506]\r\n\r\n<h2>Slider Example 1</h2>\r\n<p>This is an image slider where the image centers automatically during the effect. It also features a spotlight caption and the lightbox.</p>\r\n[widgetkit id=508]\r\n\r\n<h2>Slider Example 2</h2>\r\n<p>This is an image slider where the image stays left during the effect.</p>\r\n[widgetkit id=507]\r\n\r\n<h2>Slideshow Screen Example</h2>\r\n<p>This is an image gallery using the nice swipe effect from the slideshow widget.</p>\r\n[widgetkit id=552]\r\n\r\n<h2>Slideshow Default Example</h2>\r\n<p>This is an image gallery using all the features from the slideshow widget.</p>\r\n[widgetkit id=502]\r\n\r\n<h2>Showcase Example</h2>\r\n<p>This is a simple image showcase mashing up all the features from the slideshow and slideset widget.</p>\r\n[widgetkit id=527]\r\n\r\n<h2>Slideshow Inside Example</h2>\r\n<p>This is a very basic slideshow which uses preview thumbnails inside the image as a navigation.</p>\r\n[widgetkit id=618]\r\n\r\n<h2>Spotlight Example</h2>\r\n<p>This is an image wall with some margins and rounded corners using the spotlight and lightbox.</p>\r\n[widgetkit id=505]\r\n\r\n<h2>Slideset Example</h2>\r\n<p>This is an image gallery using all the features from the slideset widget.</p>\r\n[widgetkit id=553]\r\n\r\n<h2>How To Use</h2>\r\n\r\n<p>The Widgetkit Gallery comes with a user-friendly administration user interface which let''s you create new galleries with just a few clicks. The integrated directory browser let''s you easily add or remove source directories of your images. All galleries can be loaded anywhere in your theme using shortcodes or the universal Widgetkit Joomla module or WordPress widget.</p>', 'Gallery', '', 'publish', 'closed', 'closed', '', 'gallery', '', '', '2013-06-25 13:53:30', '2013-06-25 13:53:30', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=112', 0, 'page', '', 0),
(115, 1, '2011-07-31 16:56:31', '2011-07-31 16:56:31', '<p>The Widgetkit Map provides a simple solution for adding a map to your website. Various features let you customize the map, like changing colors and adding markers or directions.</p>\r\n\r\n<h2>Features</h2>\r\n\r\n<ul class="uk-list uk-list-space">\r\n    <li><i class="uk-icon uk-icon-check"></i> Location selection with auto geocoding</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Supports multiple map markers with text popups</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Option to get the direction to the active marker</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Supports custom map styles and colors</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Uses the latest Google Maps API</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Built with HTML5, CSS3, PHP 5.3+ and the latest jQuery version</li>\r\n    <li><i class="uk-icon uk-icon-check"></i> Works with Joomla and WordPress</li>\r\n</ul>\r\n\r\n<h2>Direction Example</h2>\r\n<p>This map features all map controls, multiple markers and you can get the direction.</p>\r\n[widgetkit id=510]\r\n\r\n<h2>Color Scheme Example</h2>\r\n<p>Set or invert the hue, saturation, lightness and gamma of a map.</p>\r\n[widgetkit id=511]\r\n\r\n<h2>Minimal Example</h2>\r\n<p>This map has a fixed width, no controls and no markers.</p>\r\n[widgetkit id=509]\r\n\r\n<h2>How To Use</h2>\r\n\r\n<p>With the Widgetkit Map you can quickly create and manage simple maps with features like multiple markers, text popups and custom color schemes. Once you have created a map, you can load it anywhere on your website using shortcodes or the universal Widgetkit Joomla module or WordPress widget.</p>', 'Map', '', 'publish', 'closed', 'closed', '', 'map', '', '', '2013-06-25 13:54:35', '2013-06-25 13:54:35', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=115', 0, 'page', '', 0),
(117, 1, '2011-07-31 16:56:46', '2011-07-31 16:56:46', '<p>The Widgetkit Media Player is a HTML5 audio and video player completely built with HTML and CSS. You can easily embed video files into your website by using the HTML5 video element. A Flash player fallback is included for all unsupported browsers.</p>\r\n\r\n<h2>Features</h2>\r\n\r\n<ul class="uk-list uk-list-space">\r\n	<li><i class="uk-icon uk-icon-check"></i> Native playback for modern HTML5 browsers</li>\r\n	<li><i class="uk-icon uk-icon-check"></i> Supports MP4 (h.264), WebM, FLV, WMV and MP3 files</li>\r\n	<li><i class="uk-icon uk-icon-check"></i> Completely built with HTML and CSS</li>\r\n	<li><i class="uk-icon uk-icon-check"></i> Responsive design to fit all device resolutions</li>\r\n	<li><i class="uk-icon uk-icon-check"></i> Same UI in all browsers</li>\r\n	<li><i class="uk-icon uk-icon-check"></i> Create your own skins</li>\r\n	<li><i class="uk-icon uk-icon-check"></i> Flash player fallback for unsupported browsers</li>\r\n	<li><i class="uk-icon uk-icon-check"></i> Works with Joomla and WordPress</li>\r\n</ul>\r\n\r\n<h2>Examples</h2>\r\n\r\n<video width="640" height="360" poster="http://www.yootheme.com/videos/mediaplayer.jpg" controls="controls" preload="none">\r\n	<source type="video/mp4" src="http://www.yootheme.com/videos/mediaplayer.mp4" />\r\n</video>\r\n\r\n<p>This is a MP3 Audio Sample:</p>\r\n\r\n<audio src="http://www.yootheme.com/videos/mediaplayer.mp3" type="audio/mp3" controls="control" preload="none"></audio>\r\n\r\n<h2>How To Use</h2>\r\n\r\n<p>Use the HTML5 <code>video</code> element to embed video in your website. For example:</p>\r\n\r\n<pre>&lt;video src="/video.mp4" width="320" height="240"&gt;&lt;/video&gt;</pre>\r\n\r\n<p>You can also provide multiple sources, to add support for the different video formats like h.264, WebM or Ogg:</p>\r\n\r\n<pre>&lt;video width="320" height="240"&gt;\r\n	&lt;source type="video/mp4"  src="/video.mp4" /&gt;\r\n	&lt;source type="video/webm" src="/video.webm" /&gt;\r\n	&lt;source type="video/ogg"  src="/video.ogv" /&gt;\r\n&lt;/video&gt;\r\n</pre>\r\n\r\n\r\n<p>Use the HTML5 <code>audio</code> element to embed MP3 files in your website. For example:</p>\r\n\r\n<pre>&lt;audio src="/audio.mp3" type="audio/mp3"&gt;&lt;/audio&gt;</pre>', 'Media Player', '', 'publish', 'closed', 'closed', '', 'media-player', '', '', '2013-06-25 13:16:37', '2013-06-25 13:16:37', '', 0, 'http://192.168.1.50/Themes/2012/Nano2/Website_WP/?page_id=117', 0, 'page', '', 0);
